import { FaUserAlt } from 'react-icons/fa';
import './Option.css'
import { Signup } from './Signup';
export const Option = () => {
    const [click, setclick] = useState(false);
    const habdleclick = () => {
        setclick(`prevState => !prevState`)
    }

    return (
        <div id='option'>
            <div id="optionList">
                <ul>
                    <li><button
                        onClick={habdleclick}
                    >

                        <FaUserAlt />  MY Profile!
                    </button></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>
            </div>
        </div>
    )
}
